 We can use React Context to create a scope context for the Tooltip component.

## Create a Tooltip Context

Create a Tooltip Context to store the Tooltip state and the function to close the Tooltip.
```
import { createContext } from "react";

export const TooltipContext = createContext({
  closeTooltip: () => {},
});
```
## Create a Tooltip Provider

Create a Tooltip Provider to provide the Tooltip state and the function to close the Tooltip.
```
import { useState } from "react";
import { TooltipContext } from "./TooltipContext";

export const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = useState(null);

  const closeTooltip = () => {
    setTooltip(null);
  };

  return (
    <TooltipContext.Provider value={{ tooltip, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};
```
## Create a Tooltip Component

Create a Tooltip component to display the Tooltip.
```
import { useContext } from "react";
import { TooltipContext } from "./TooltipContext";

export const Tooltip = ({ children }) => {
  const { tooltip, closeTooltip } = useContext(TooltipContext);

  return (
    <div className="tooltip">
      {tooltip && (
        <div className="tooltip-content">
          <div className="tooltip-arrow" />
          <div className="tooltip-inner">{tooltip}</div>
        </div>
      )}
      {children}
    </div>
  );
};
```
## Create a Tooltip Trigger Component

Create a Tooltip Trigger component to trigger the Tooltip.
```
import { useContext } from "react";
import { TooltipContext } from "./TooltipContext";

export const TooltipTrigger = ({ children, tooltip }) => {
  const { setTooltip } = useContext(TooltipContext);

  return (
    <div
      className="tooltip-trigger"
      onMouseEnter={() => setTooltip(tooltip)}
      onMouseLeave={() => setTooltip(null)}
    >
      {children}
    </div>
  );
};
```
## Use the Tooltip Component

Use the Tooltip component in your NextJS application.
```
import { TooltipProvider, Tooltip, TooltipTrigger } from "./Tooltip";

export default function App() {
  return (
    <TooltipProvider>
      <Tooltip>
        <TooltipTrigger tooltip="Hello World">
          <button>Hover me</button>
        </TooltipTrigger>
      </Tooltip>
    </TooltipProvider>
  );
}
```
## Conclusion

In this article, we learned how to create a Tooltip in NextJS using React Context. We also learned how to create a Tooltip Provider and a Tooltip Trigger component.

